import React, {useState} from 'react';
import PhotoAlbum from "react-photo-album";
import sunny from '../images/fanart/sunny.png';

export default function Fanart (){

  const photos = [
    {
        src: {sunny},
        width: 800,
        height: 600
    },
    {
        src: {sunny},
        width: 1600,
        height: 900
    }
];

  return (
      <div>
        Fanart
        <PhotoAlbum layout="rows" photos={photos} />
      </div>
  )
}
